import styled from "styled-components";

const map = new Map();
export const tomato = styled.li`
  background-color: rgba(227, 26, 0, 1);
`;
map["tomato"] = tomato;
export const IngredientList = (ingredienName) => {
  return styled.li`
    background-color: rgba(227, 26, 0, 1);
  `;
  //   return map[ingredienName];
};
